// Presentational.js
import React from 'react';
import Header from './Header/Header';
import HeroContainer from './HeroContainer';
import './Header/Header.css';
import './Style.css'

const Presentational = () => {
  return (
    <div className='Presentation'>
      <Header />
      <HeroContainer />
    </div>
  );
};

export default Presentational;
